@PublicHealthWales @WendyGeorginaL2 
No medicine is without risk. To put it into context, the risk of 
blood clots from the contraceptive pill is 0.05% to 0.1%. The risk of blood clots from the AstraZeneca COVID-19 vaccine is currently around 0.0003%..

They sold the vaccines to foreign countries, which were meant for our children! Shame

If we get two billion vaccines by end of 2021, what about the vaccine famine until then?

